import React from "react";
import home from "./HomePage.module.css"

const HomePage = (props) => {
    console.log(props)
    return (
        <div>
            <ul className={home.list}>
                <a href={"/" + props.id} className={home.item}>{props.name}</a>
            </ul>
        </div>
    )
}

export default HomePage
